```
#include <stdio.h>

void func() {
    static int x = 10; // static variable
    register int y = 20; // register variable

    printf("x = %d\n", x);
    printf("y = %d\n", y);

    x++;
    y++;
}

int main() {
    func();
    func();
    return 0;
}
```
